                  Information Technology. I am interested in graphic designing.
                  <br />I can assist with producing clean and functional design
                  where required. I love listening music and like to play
                  table-tennis.
                </p>
              </Zoom>
            </Col>
          </Row>
        </Container>

        <Skills />

        <Experience />

        <Interests />

        <Projects />

        <Achievements />

        <Footer />
      </div>
    );
  }
}

export default Landing;
